import React from "react";
import { Link } from 'react-router-dom';





export const Users = () =>{

    const user = {
        name: 'Adison',
        surname: 'Gonsior',
        city: 'Bielsko',
        }



    return(

        <div>
            <button>
                <Link to={`/users/${user.name}`}>{user.name}</Link>
            </button>


        </div>
    )
}
